ive Hercule Poirot, and saxophonist Clarence Clemons. But here we are, in the present moment, the only time that actually exists – according to Zen Buddhism (and The Stooges) – and a. Tom Collins walks among us; taking note of the wilderness of horrors and occasional blips of joy that are this waking Life – and turning them into boozy, moody, stomp-and-wrangle-worthy anthems of the Now Times. With inexhaustible insight and a smoky voice, Collins slithers, smooths and seduces his notes into your skull and soul; lilting and tilting the moments between awareness and suffering; the hot potato game of tragic flaws; leaning on and propping up love, alternately. When not hammering at a piano and caterwauling the damnable Truth with his amazing band, a. Tom Collins enjoys raising rare and endangered cacti (and select other succulents) in his sprawling conservatory, non-competitive baton-fighting, and sitting alone in a darkened room smoking bidis and watching 16mm loops of WWI newsreels.","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-atjmbo.jpg","width":170,"height":113},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-atjmbo1.jpg","width":170,"height":113},"large":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-atlg.jpg","width":170,"height":113},"large1":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-atlg1.jpg","width":170,"height":113},"medium":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-atmd.jpg","width":170,"height":113},"medium1":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-atmd1.jpg","width":170,"height":113},"original":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-og.jpg","width":170,"height":113},"small":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-atsm.jpg","width":100,"height":66},"small1":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-atsm1.jpg","width":100,"height":66},"square":{"path":"http://cdn.ticketfly.com/i/00/00/79/95/55-sq.jpg","width":100,"height":100},"squar